         ELSE AC_TALCOA2.parent_name
          END PN2,
            CASE WHEN AC_TCOA.PARENT_ID2=0 
         THEN 	AC_TALCOA8. CODE  
         ELSE AC_TALCOA2. CODE
          END PN2_Code,
            AC_TCOA.PARENT_ID3,
            IFNULL(AC_TALCOA3.parent_name,'')PN3,
            IFNULL(AC_TALCOA3. CODE,'')PN3_Code,
