   (SUM(IFNULL(AC_TAVDtl.GR_DEBIT,0)) - SUM(IFNULL(AC_TAVDtl.GR_CREDIT,0)) ) AS Opening
    ,AC_TCOA.CHILD_ID   , IFNULL(AC_TALCOA8.parent_name,'') CN   , IFNULL(AC_TALCOA8.code,'') CN_Code
