	SELECT
		CHILD_ID
	FROM
		ac_tb_coa
	WHERE
		PARENT_ID1 = 27  
	AND CHILD_ID <> 0
	UNION ALL
		SELECT
			CHILD_ID
		FROM
			ac_tb_coa
		WHERE
			PARENT_ID2 = 27 
		AND CHILD_ID <> 0
		UNION ALL
			SELECT
				CHILD_ID
			FROM
