        GROUP BY AC_TAVDtl.CHILD_ID
        ) ledger_transaction on ledger_transaction.CHILD_ID=ALL_LEDGER.CHILD_ID
/*END tab table*/
)
tab 
GROUP BY
tab.PARENT_ID,
tab.PARENT_ID1,
tab.PARENT_ID2
